function saveMatch(b) {
    $.post('lsdb/Match.php', {
        action: 'save',
        mkey: $('#mkey' + b).val(),
        sh: $('#sh' + b).val(),
        sa: $('#sa' + b).val(),
        lh: $('#lh' + b).val(),
        la: $('#la' + b).val(),
        mstat: 4
    }, function (a) {
        $('#trm' + b).html(a);
        $('#msg' + b).html('Gespeichert ...').css("background-color", "#CCFFCC")
    })
};

function savemcomment() {
    $.post('lsdb/Match.php', {
        action: 'newcomment',
        mkey: $('#mkey').val(),
        mcomment: $('#f23').val()
    }, function (a) {
        $('#resp4').html(a)
    })
};

function saveMatchA() {
    $.post('lsdb/Match.php', {
        action: 'save',
        mkey: $('#mkey').val(),
        sh: $('#sh').val(),
        sa: $('#sa').val(),
        lh: $('#lh').val(),
        la: $('#la').val(),
        mstat: $('#mstatus').val()
    }, function (a) {
        $('#debug').html(a)
    })
};

function getGame(b) {
    $.post('lsdb/Game.php', {
        action: 'get',
        gid: b,
        eid: $('#eid').val(),
        mkey: $('#mkey').val()
    }, function (a) {
        $('#trg' + b).html(a);
        $('#trg' + b).css("background-color", "#CCEEFF")
    });
    $('#trg' + b).css("background-color", "#FFFFFF")
};

function resetGame(b) {
    if (confirm('Das Spiel und alle damit gespeicherten Legs löschen ??')) {
        $.post('lsdb/Game.php', {
            action: 'reset',
            gid: b,
            eid: $('#eid').val(),
            mkey: $('#mkey').val()
        }, function (a) {
            $('#trg' + b).html(a);
            $('#trg' + b).css("background-color", "#FFDDDD")
        });
        $('#trg' + b).css("background-color", "#FFFFFF")
    }
};

function saveGame(a) {
    if ((checkempty('ph' + a) + checkempty('pa' + a)) > 0) {
        alert('Player missing..');
        return 0
    };
    var b = $('#gph' + a).val() + ':' + a + ':' + $('#ph' + a).val() + ':' + $('#th' + a).val() + ':' + $('#lh' + a).val();
    var c = $('#gpa' + a).val() + ':' + a + ':' + $('#pa' + a).val() + ':' + $('#ta' + a).val() + ':' + $('#la' + a).val();
    return saveGameEx(a, b, c, '', '')
};

function saveGameD(a) {
    if ((checkempty('c0p' + a) + checkempty('c1p' + a) + checkempty('c2p' + a) + checkempty('c3p' + a)) > 0) {
        alert('Player missing..');
        return 0
    };
    var b = $('#c0gp' + a).val() + ':' + a + ':' + $('#c0p' + a).val() + ':' + $('#c0t' + a).val() + ':' + $('#lh' + a).val();
    var c = $('#c1gp' + a).val() + ':' + a + ':' + $('#c1p' + a).val() + ':' + $('#c1t' + a).val() + ':' + $('#lh' + a).val();
    var d = $('#c2gp' + a).val() + ':' + a + ':' + $('#c2p' + a).val() + ':' + $('#c2t' + a).val() + ':' + $('#la' + a).val();
    var e = $('#c3gp' + a).val() + ':' + a + ':' + $('#c3p' + a).val() + ':' + $('#c3t' + a).val() + ':' + $('#la' + a).val();
    return saveGameEx(a, b, d, c, e)
};

function saveGameEx(b, c, d, e, f) {
    $.post('lsdb/Game.php', {
        action: 'save',
        r1: c,
        r2: d,
        r3: e,
        r4: f,
        gid: b,
        eid: $('#eid').val(),
        mkey: $('#mkey').val()
    }, function (a) {
        $('#trg' + b).html(a);
        $('#msg' + b).html('Gespeichert ...').css("background-color", "#BBFFBB")
    });
    return 1
};

function editGame(b) {
    if (!saveGame(b)) {
        return
    }
    $.post('lsdb/Game.php', {
        action: 'gdetail',
        gid: b,
        eid: $('#eid').val(),
        mkey: $('#mkey').val()
    }, function (a) {
        $('#trged' + b).html(a).show()
    })
};

function closeed(a) {
    $('#trged' + a).slideUp("fast")
};

function saveLegs(d, e) {
    var f = document.getElementById('TG' + d + 'P' + e);
    ridx = f.rows.length;
    if (!ridx > 1) {
        alert('No data to save, add some legs first');
        return
    }
    var g = new Array();
    var h = '';
    for (r = 1; r < ridx; r++) {
        R = f.rows[r];
        res = '|L:' + R.id + ',G:' + d + ',P:' + e;
        for (c = 1; c < R.cells.length; c++) {
            C = R.cells[c];
            res += ',' + C.childNodes[0].id + ':' + C.childNodes[0].value
        }
        g.push(res)
    }
    g.forEach(function (a, b) {
        h += a
    });
    $('#TG' + d + 'P' + e).parent().parent().parent().parent().block();
    $.post('lsdb/Game.php', {
        action: 'savelegs',
        gid: d,
        eid: $('#eid').val(),
        mkey: $('#mkey').val(),
        ldata: h
    }, function (a) {
        $('#trg' + d).html(a);
        $('#TG' + d + 'P' + e).show();
        $('#TG' + d + 'P' + e).parent().parent().parent().parent().unblock();
    })
};

function addLeg(b, c) {
    $.post('lsdb/Game.php', {
        action: 'addleg',
        pid: c,
        gid: b,
        eid: $('#eid').val(),
        mkey: $('#mkey').val()
    }, function (a) {
        $('#trged' + b).html(a)
    })
};

function remLeg(b, c) {
    $.post('lsdb/Game.php', {
        action: 'delleg',
        lid: b,
        gid: c,
        eid: $('#eid').val(),
        mkey: $('#mkey').val()
    }, function (a) {
        $('#trged' + c).html(a)
    })
};

function calcResult() {
    $.post('lsdb/Match.php', {
        action: 'sumup',
        eid: $('#eid').val(),
        mkey: $('#mkey').val()
    }, function (a) {
        $('#msum').html(a)
    })
};